gqu(){return"Pol\xedtica de privacidad \u2013 Aplicaci\xf3n ASConnect\n\n1) Responsable del tratamiento\nLos datos recopilados en la aplicaci\xf3n ASConnect son tratados por FAST France como responsable del tratamiento.\nPara cualquier pregunta relativa a sus datos o al ejercicio de sus derechos, puede contactarnos en: contact@fastfrance.org.\n\n2) Finalidades del tratamiento\nLos tratamientos de datos realizados a trav\xe9s de la aplicaci\xf3n persiguen las siguientes finalidades:\n\u2022 Crear y gestionar su cuenta de usuario para acceder a la aplicaci\xf3n ASConnect;\n\u2022 Utilizar funciones de geolocalizaci\xf3n para visualizar:\n  o puntos de inter\xe9s relacionados con el s\xedndrome de Angelman,\n  o y/o perfiles de personas afectadas, seg\xfan distintos criterios (distancia geogr\xe1fica, genotipo, rango de edad);\n\u2022 Mejorar el servicio y personalizar la experiencia del usuario, incluyendo la posibilidad de elegir si desea mostrar una foto, su nombre o su apellido.\n\n3) Categor\xedas de datos recopilados\nSe pueden recopilar los siguientes datos:\n\u2022 Datos de identificaci\xf3n:\n  o apellido, nombre, correo electr\xf3nico, contrase\xf1a, foto,\n  o pregunta y respuesta secretas (en caso de olvido de la contrase\xf1a);\n\u2022 Datos sensibles:\n  o genotipo, ubicaci\xf3n del tel\xe9fono (geolocalizaci\xf3n).\nLa base legal de estos tratamientos se basa en el consentimiento expl\xedcito e informado del usuario.\n\n4) Plazo de conservaci\xf3n\nLos datos se conservan durante todo el tiempo de uso de la cuenta y luego se eliminan en un plazo m\xe1ximo de 12 meses tras la \xfaltima actividad.\nEl usuario puede ejercer su derecho al olvido en cualquier momento directamente en la aplicaci\xf3n, a trav\xe9s de:\nPol\xedtica de privacidad \u2192 Derecho al olvido.\n\n5) Destinatarios y alojamiento\nLos datos se alojan de forma segura en los servidores de PythonAnywhere.\nLos datos se almacenan en la Uni\xf3n Europea.\n(Para m\xe1s informaci\xf3n sobre la pol\xedtica de privacidad del proveedor, consulte https://www.pythonanywhere.com/privacy/.)\n\n6) Derechos de los usuarios\nDe conformidad con el Reglamento (UE) 2016/679 (RGPD), los usuarios disponen de los siguientes derechos:\n\u2022 Derecho de acceso, rectificaci\xf3n y supresi\xf3n (\u201cderecho al olvido\u201d) \u2014 directamente desde su perfil o desde Pol\xedtica de privacidad \u2192 Derecho al olvido;\n\u2022 Derecho de oposici\xf3n, portabilidad y limitaci\xf3n del tratamiento;\n\u2022 Derecho a retirar el consentimiento en cualquier momento.\nPara ejercer estos derechos (distintos del derecho al olvido dentro de la aplicaci\xf3n), puede enviar un correo a: contact@fastfrance.org.\n\n7) Seguridad y confidencialidad\nTodos los datos se cifran durante el almacenamiento y la transmisi\xf3n.\nLas contrase\xf1as se almacenan mediante hash siguiendo buenas pr\xe1cticas de seguridad y toda la comunicaci\xf3n con el servicio se realiza mediante HTTPS.\n\n8) Consentimiento expl\xedcito\nEl registro en la aplicaci\xf3n ASConnect requiere el consentimiento expl\xedcito e informado del usuario para los tratamientos descritos en la secci\xf3n 2.\nEl usuario puede retirar su consentimiento en cualquier momento desde la configuraci\xf3n de su cuenta o contactando con contact@fastfrance.org."},
