gqu(){return"Polityka prywatno\u015bci \u2013 aplikacja ASConnect\n\n1) Administrator danych\nDane zebrane w aplikacji ASConnect s\u0105 przetwarzane przez FAST France jako administratora danych.\nJe\u015bli masz pytania dotycz\u0105ce Twoich danych lub sposobu wykonywania Twoich praw, skontaktuj si\u0119 z nami: contact@fastfrance.org.\n\n2) Cele przetwarzania\nPrzetwarzanie danych realizowane za po\u015brednictwem aplikacji s\u0142u\u017cy nast\u0119puj\u0105cym celom:\n\u2022 Tworzenie i zarz\u0105dzanie Twoim kontem u\u017cytkownika w celu uzyskania dost\u0119pu do aplikacji ASConnect;\n\u2022 Korzystanie z funkcji geolokalizacji w celu wy\u015bwietlania:\n  o punkt\xf3w zainteresowania zwi\u0105zanych z zespo\u0142em Angelmana,\n  o i/lub profili os\xf3b, wed\u0142ug r\xf3\u017cnych kryteri\xf3w (odleg\u0142o\u015b\u0107 geograficzna, genotyp, przedzia\u0142 wiekowy);\n\u2022 Ulepszanie us\u0142ugi i personalizacja do\u015bwiadczenia u\u017cytkownika, w tym umo\u017cliwienie u\u017cytkownikom wyboru, czy wy\u015bwietla\u0107 zdj\u0119cie, imi\u0119 lub nazwisko.\n\n3) Kategorie zbieranych danych\nMog\u0105 by\u0107 zbierane nast\u0119puj\u0105ce dane:\n\u2022 Dane identyfikacyjne:\n  o nazwisko, imi\u0119, adres e-mail, has\u0142o, zdj\u0119cie,\n  o pytanie i odpowied\u017a zabezpieczaj\u0105ce (w przypadku zapomnianego has\u0142a);\n\u2022 Dane wra\u017cliwe:\n  o genotyp, lokalizacja telefonu (geolokalizacja).\nPodstaw\u0105 prawn\u0105 tego przetwarzania jest wyra\u017ana i \u015bwiadoma zgoda u\u017cytkownika.\n\n4) Okres przechowywania danych\nDane s\u0105 przechowywane przez okres korzystania z konta, a nast\u0119pnie usuwane maksymalnie w ci\u0105gu 12 miesi\u0119cy od ostatniej aktywno\u015bci.\nU\u017cytkownicy mog\u0105 skorzysta\u0107 z prawa do bycia zapomnianym w dowolnym momencie bezpo\u015brednio w aplikacji:\nPolityka prywatno\u015bci \u2192 Prawo do bycia zapomnianym.\n\n5) Odbiorcy danych i hosting\nDane s\u0105 bezpiecznie hostowane na serwerach PythonAnywhere.\nDane s\u0105 przechowywane w Unii Europejskiej.\n(Wi\u0119cej informacji w polityce prywatno\u015bci hosta: https://www.pythonanywhere.com/privacy/.)\n\n6) Prawa u\u017cytkownik\xf3w\nZgodnie z Rozporz\u0105dzeniem (UE) 2016/679 (RODO), u\u017cytkownikom przys\u0142uguj\u0105 nast\u0119puj\u0105ce prawa:\n\u2022 Prawo dost\u0119pu, sprostowania i usuni\u0119cia (\u201eprawo do bycia zapomnianym\u201d) \u2014 bezpo\u015brednio przez profil lub przez Polityka prywatno\u015bci \u2192 Prawo do bycia zapomnianym;\n\u2022 Prawo sprzeciwu, przenoszenia danych i ograniczenia przetwarzania;\n\u2022 Prawo do wycofania zgody w dowolnym momencie.\nAby skorzysta\u0107 z tych praw (poza prawem do bycia zapomnianym w aplikacji), wy\u015blij e-mail: contact@fastfrance.org.\n\n7) Bezpiecze\u0144stwo i poufno\u015b\u0107\nWszystkie dane s\u0105 szyfrowane podczas przechowywania i transmisji.\nHas\u0142a s\u0105 haszowane zgodnie z najlepszymi praktykami bezpiecze\u0144stwa, a ca\u0142a komunikacja z us\u0142ug\u0105 odbywa si\u0119 przez HTTPS.\n\n8) Wyra\u017ana zgoda\nRejestracja w aplikacji ASConnect wymaga wyra\u017anej i \u015bwiadomej zgody u\u017cytkownika na przetwarzanie opisane w punkcie 2.\nU\u017cytkownicy mog\u0105 wycofa\u0107 zgod\u0119 w dowolnym momencie w ustawieniach konta lub kontaktuj\u0105c si\u0119 z contact@fastfrance.org."},
